<p>ئۆستەڭ بويى كوچا باشقارمىسى <ref target="https://ug.wikipedia.org/wiki/قەشقەر_ۋىلايىتى">قەشقەر ۋىلايىتى</ref> نىڭ <ref target="https://ug.wikipedia.org/wiki/قەشقەر_شەھىرى">قەشقەر شەھىرى</ref> دىكى بىر كوچا باشقارمىسى بولۇپ، تارمىقىدا 6 مەھەللە بار، ئومۇمىي نوپۇسى 50.5 مىڭ.</p>
